const scripts=document.getElementsByTagName('script');const thisScript=scripts[scripts.length-1];const form=thisScript.getAttribute('form')||'https://examples.form.io/example';const lang=thisScript.getAttribute('lang')?thisScript.getAttribute('lang').split(','):['en'];const defaultLanguage=lang[0];let head=document.getElementsByTagName('head')[0];let formiojs=document.createElement('script');formiojs.src='https://unpkg.com/formiojs@latest/dist/formio.full.min.js';formiojs.type='text/javascript';let formiocss=document.createElement('link');formiocss.href='https://unpkg.com/formiojs@latest/dist/formio.full.min.css';formiocss.rel='stylesheet';head.appendChild(formiocss);head.appendChild(formiojs);let id=`formio-${Math.random().toString(36).substring(7)}`;let code=`<div id="${ id }"></div>`;document.write(code);window.onload=function(){let el=document.getElementById(id);let formio=new Formio(form);let options={language:defaultLanguage,i18n:{}};let translationsUrl=formio.projectUrl.concat('/translations/submission?limit=1000&select=data.label');for(let i=0;i<lang.length;i+=1){options.i18n[lang[i]]={};translationsUrl+=',data.'+lang[i]}Formio.request(translationsUrl,'get').then(function(submissions){for(let i=0;i<submissions.length;i+=1){for(let j=0;j<lang.length;j+=1){if(submissions[i].data.hasOwnProperty(lang[j])){options.i18n[lang[j]][submissions[i].data.label]=submissions[i].data[lang[j]]}}}Formio.createForm(el,formio.formUrl,options).then(function(form){form.language=defaultLanguage})});thisScript.remove()};